import logo from "./logo.svg";
import "./App.css";
import Todo from "./pages/todo";
import Login from "./components/login";
import { useEffect } from "react";

function App() {
  useEffect(() => {
    const test = localStorage.getItem("test");
    console.log(test);
  });
  {
    <>
      <Login />;
      <Todo />;
    </>;
  }
}

export default App;
